import React from "react";
import { Link } from "react-router-dom";
const Header = () => {
  return (
    <div className="flex justify-center space-x-2">
      <div>
        {/* <a href="/home">Home</a> */}
        <Link to="/home">Home</Link>
      </div>
      <div>
        <a href="/about">About</a>
      </div>
    </div>
  );
};

export default Header;
